import React, { Suspense, lazy } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Loading from "./Pages/Loading/Loading"; // You can use this as the fallback while pages load

// Lazy load the components
const Work = lazy(() => import("./Pages/Work/Work"));
const Info = lazy(() => import("./Pages/Info/Info"));
const Projects = lazy(() => import("./Pages/Projects/Projects"));
const Projects2 = lazy(() => import("./Pages/Projects/Projects2"));
const Projects3 = lazy(() => import("./Pages/Projects/Projects3"));
const Projects4 = lazy(() => import("./Pages/Projects/Projects4"));

function App() {
  return (
    <Router>
      <div className="App">
        {/* Suspense provides a fallback UI while the components are loading */}
        <Suspense fallback={<Loading />}>
          <Routes>
            <Route path="/Work" element={<Work />} />
            <Route path="/" element={<Loading />} />
            <Route path="/Info" element={<Info />} />
            <Route path="/Projects" element={<Projects />} />
            <Route path="/Projects2" element={<Projects2 />} />
            <Route path="/Projects3" element={<Projects3 />} />
            <Route path="/Projects4" element={<Projects4 />} />
          </Routes>
        </Suspense>
      </div>
    </Router>
  );
}

export default App;
